import './App.css';
import { AttackPage } from './Pages/AttackPage';
import { Pages } from './Pages/Show'
import {
  BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path='/'>
            <AttackPage/>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
